Always in a rush, Kelly is hoping to be able to return her car to the garage before getting on with her busy day. When the mechanic finds a suspicious stain in the back, however, he decides to do a thorough examination of the vehicle. Although Kelly's transmission might not be fucked, her ass sure will be as the mechanic shows her how to properly open her back door.
